import React, { Component } from 'react';


class WeekWeather extends Component {
    state = {  }
    render() { 
        return ( 
            <div class="weeks-weather">
                <h2>This Week's Weather</h2>
                <p>City: {this.props.location}</p>
                     {this.props.weather.map((item,i) =>
                     <ul>
                        <li>Date: </li>
                           {item[0]}
                        <br></br>
                        </ul>
                        )} 
            </div>
         );
    }
}

export default WeekWeather;
